import React from 'react'
import logo from "./Images/logo.png"
import { Link } from "react-scroll";
function Footer() {
  return (
    <footer className='footer-container'>
      <div className='footer-link-container'>
        <div>
          <img src={logo} alt="Dipika Jain" />
        </div>
        <div className='footer-items'>
        <ul>
            <li>
              <Link
                activeClass="navbar-active-content"
                spy={true}
                smooth={true}
                // offset={-70}
                duration={500}
                to="heroSection"
                className="navbar-content"
              >
                Home
              </Link>
            </li>
            
          <li>
            <Link
              activeClass="navbar-active-content"
              spy={true}
              smooth={true}
              // offset={-70}
              duration={500}
              to="AboutMe"
              className="navbar-content"
            >
              About Me
            </Link>
          </li>
          <li>
            <Link
              activeClass="navbar-active-content"
              spy={true}
              smooth={true}
              // offset={-70}
              duration={500}
              to="mySkills"
              className="navbar-content"
            >
              Skills
            </Link>
          </li>
          <li>
          <Link
              activeClass="navbar-active-content"
              spy={true}
              smooth={true}
              // offset={-70}
              duration={500}
              to="projects"
              className="navbar-content"
            >
              Project
            </Link>
          </li>
          <li>
          <Link
              activeClass="navbar-active-content"
              spy={true}
              smooth={true}
              // offset={-70}
              duration={500}
              to="experience"
              className="navbar-content"
            >
              Experience
            </Link>
          </li>
          
          </ul>
        </div>
      </div>
    </footer>
  )
}

export default Footer
